  false,\n\t\"url\": null,\n\t\"notes\": \"This data represents a vegetation map for
  Bluestone National Scenic River. It contains nonoverlapping polygons which represent
  vegetation classes, aquatic features, and cultural features. Vegetation types were
  classified based on statistical analysis of plot data collected on the ground from
  2003 through 2005. Polygons were delineated based on interpretation of digital and
  hard copy aerial photography flown in 2003.\",\n\t\"license_title\": null,\n\t\"extras\":
